    [],nt"revision_timestamp": "2015-09-26T21:59:54.129507",nt"name": "geomagnetic-components-d-h-x-y-z-and-r-10-second-instantaneous-measurements",nt"isopen":
    false,nt"url": null,nt"notes": "These data are generated as part of the
    International Magnetospheric Study. The file consists of 10-second instantaneous
    measurements for the geomagnetic components D, H, X, Y, Z and R. The 10 second values
    were collected digitally in real time by a network of 26 ground observatories and
    relayed to the Space Environment Center, Boulder, Colorado, via the SMS-GOES satellite
    and the Wallops Island, Virginia ground station. The 1-minute average values aren
                       computed at the Space Environment Center in Boulder, Colorado.
    The entry ID number for the 1-minute values is Dataset_ID G00124. These data were
    generated as part of the International Magnetospheric Study. The file is comprised
    of values of the geomagnetic components D, H, X, Y, Z and R from instantaneous measurements
    taken at 10-second intervals at ground observatories. The 10-second values are collected
    digitally in real time at the magnetic observatories and relayed to then                    Space
    Environment Center via the SMS-GOES satellite to up to 26 geomagnetic observatories
    that provide data. The data are not continuous in time for all observatories and
    not necessarily continuous in time sequence for all elements at any one observatory.
    The sources for the data are the following chains of geomagnetic observatories:
    Alaska Chain, Churchill Chain, East-West Chain and Mid-Latitude Chain.",nt"license_title":
